import * as React from 'react';
import { Avatar } from 'react-native-paper';
const G_LOGO = '../../../assets/googleIcon.svg';

const GAuth = () => {
  return (
    <div>
        <Avatar.Image size={24} 
        icon="google"
        // source={require('../../../assets/GLogo')} 
        />
    </div>
  )
}

export default GAuth
